import React from 'react';
import styled from 'styled-components';
import { MdModeEdit, MdDelete } from 'react-icons/md';

const Remove = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  font-size:24px;
  cursor: pointer;
  `
  const Edit = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    font-size:24px;
    cursor: pointer;
  `

const filterItem = styled.div`
  background: #f3d9fa;
  width: 32px;
  height: 32px;
  border-radius: 5px;
  font-size: 24px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-right: 20px;
`
const Contents = styled.div`
  /* flex: 1; */
  font-size: 21px;
`

const ExpenditureItemBlock = styled.div`
   display: flex;
  align-items: center;
  padding-top:12px;
  padding-bottom: 12px;
  border: 1px solid brown;

`

function ExpenditureItem() {
  return (
    <ExpenditureItemBlock>
     <filterItem></filterItem>
     <Contents></Contents>
     <Edit></Edit>
     <Remove></Remove>
    </ExpenditureItemBlock>
  )
}
export default ExpenditureItem;
